/*Insert values into W_LEAD_F*/
COMMIT;

/*Insert values into W_JOB_CHANGE_DATA*/
COMMIT;

SELECT WJCD.COUNT	AS COUNT_W_JOB_CHANGE_DATA, /*600 Rows*/
       WLF.COUNT	AS COUNT_W_LEAD_F /*3600 Rows (600 new rows plus 3000 rows with original data)*/
FROM (SELECT COUNT(*) AS COUNT FROM W_JOB_CHANGE_DATA) WJCD,
     (SELECT COUNT(*) AS COUNT FROM W_LEAD_F) WLF;